import React from "react";
import "./Styles/Pages.css";

const Contact = () => {
  return (
    <div id="Contact">
      <head>
        <title>Contact</title>
      </head>
      <div className="title">
        <h1>Halaman Contact</h1>
      </div>
  </div>
  );
};

export default Contact;
